  [],\n\t\"revision_timestamp\": \"2016-10-08T14:53:47.372765\",\n\t\"name\": \"hcup-state-inpatient-databases-sid-restricted-access-file\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The State Inpatient Databases (SID) contain
  the universe of hospital inpatient discharge abstracts in States participating in
  HCUP that release their data through the HCUP Central Distributor.  Restricted access
  data files are available with a data use agreement and brief online security training.</p>n<p>The
  data are translated into a uniform format to facilitate multi-State comparisons
  and analyses.  The SID are based on data from short term, acute care, nonfederal
  hospitals.  Some States include discharges from specialty facilities, such as acute
  psychiatric hospitals.  The SID include all patients, regardless of payer, e.g.,
  persons covered by Medicare, Medicaid, private insurance, and the uninsured.  The
  SID contain clinical and resource use information included in a typical discharge
  abstract, with safeguards to protect the privacy of individual patients, physicians,
  and hospitals (as required by data sources).  Data elements include but are not
  limited to: diagnoses, procedures, admission and discharge status, patient demographics
  (e.g., gender, age), total charges, length of stay, and expected payment source
  (e.g., Medicare, Medicaid, private insurance, self-pay; for some States, additional
  discrete payer categories, such as managed care).  In addition to the core set of
  uniform data elements common to all SID, some include State-specific data elements,
  such as the patient's race.  The SID exclude data elements that could directly or
  indirectly identify individuals.  For some States, hospital and county identifiers
  are included that permit linkage to the American Hospital Association Annual Survey
  File and the Area Resource File.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
